EL NUEVO DIARIO, SANTO DOMINGO.- La Facultad de Ciencias Económicas y Sociales (FCES) de la Universidad Autónoma de Santo Domingo (UASD), en el marco de la celebración de su 66 aniversario, realizó este martes una conferencia virtual titulada, “El Valor de la Estadística en un Mundo Globalizado e Interconectado”, a cargo del director de la Escuela de Estadística de la academia, maestro Faustino Polanco.
El decano de la FCES, maestro Alexi Martínez, en representación de la rectora, Emma Polanco M
