o para el intercambio comercial y la divulgación de datos, constituyendo un elemento fundamental para entender e interpretar el mundo globalizado.
Señaló que entidades como el Banco Mundial; la Organización Mundial del Turismo; el Fondo Monetario Internacional y el Programa de las Naciones Unidas para el Desarrollo (PNUD) promueven el conocimiento y las aplicaciones de la Estadística, para lo cual requieren de los países datos estadísticos confiables, como parte de las tareas necesarias propias 
... (794 chars skipped) ...
mbio de bienes y servicios entre los relacionados”, señaló el maestro Polanco.
